import React from "react";
import { useNavigate } from "react-router-dom";

export default function Welcome() {
    const navigate = useNavigate();
    if(!localStorage.getItem('token')){
        navigate("/welcome");
    }
  return (
    <div>Welcome</div>
  )
}
